import classes from "./../../css/Dialogs.module.css";
import { NavLink } from 'react-router-dom';

const Contact = (props) => {
	let path = "/dialogs/" + props.id;
	
	return (
		<NavLink to={path}><li>{props.name}</li></NavLink>
	);
}

const Contacts = (props) => {

	let contactArr = [
		{ id: 0, name: "Даун Иваныч"},
		{ id: 1, name: "Лох Иваныч" },
		{ id: 2, name: "Мочевин Уретров" }
	]

	
	let contactElements = [
		<Contact name={contactArr[0].name} id={contactArr[0].id} />,
		<Contact name={contactArr[1].name} id={contactArr[1].id} />,
		<Contact name = { contactArr[2].name } id = { contactArr[2].id } />
	]

	return (
		<div>
			<h2>Контакты</h2>
			<div>
				<ul>
					{contactElements}
				</ul>
			</div>
		</div>
	);
}

export default Contacts;
